  false,\n\t\"url\": null,\n\t\"notes\": \"Gridded multibeam bathymetry is integrated
  with derived bathymetry from alternate sources to provide a GIS layer with expanded
  spatial coverage.nnIntegrated products for American Samoa includes multibeam bathymetry
  and bathymetry derived from IKONOS satellite imagery. Integrated bathymetry for
  the Northwestern Hawaiian Islands includes multibeam bathymetry and bathymetry derived
  from IKONOS satellite imagery. Integrated products for the Commonwealth of the Northern
  Mariana Islands includes multibeam bathymetry and bathymetry derived from IKONOS
  satellite imagery. Bathymetry data for Kaanapali, Maui was derived from DigitalGlobe's
  WorldView imagery. Integrated products for Guam includes mulitbeam bathymetry and
  SHOALS lidar data.nnPlease see the individual metadata records for additional information
  on the source data and processing methodologies.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
